            column-gap: 22px;
            @media screen and (max-width:1024px){
                column-gap: 18px;
            }
            .service__acord-btn{
                display: flex;
                align-items: center;
                justify-content: start;
                background-color: #FFFFFF;
                border: 1px solid #C6CBCD;
                width: 100%;
                padding: 25px 20px;
                font-style: normal;
                font-weight: 700;
                font-size: 24px;
                line-height: 28px;
                transition: 0.3s ease;
                cursor: pointer;
                &:hover{
                    background-color: #f0efef;
                    transition: 0.3s;
                }
                span{
                    margin-left: 40px;
                }
                .btn-up{
                    margin-left: auto;
                }
                .btn-down{
                    margin-left: auto;
                }
                @media screen and (max-width:1024px){
                    font-size: 18px;
                    line-height: 21px;
                    padding: 18px 10px;
                }
            }
            .service__acord-panel{
                display: none;
                padding: 10px 20px 10px 0px;                
                border: 1px solid #C6CBCD;
                @media screen and (max-width:1024px){
                    padding: 5px 10px 5px 0px;
                }
                textarea{
                    width: 100%;
                    padding: 20px;
                    resize: none;
                    font-style: normal;
                    font-weight: 400;
                    font-size: 18px;
                    line-height: 21px;
                    white-space: normal;
                    background-color: #FFFFFF;
                    border: none;
                    text-align: justify;
                    padding-right: 40px;
                    height: 163px;
                    &::-webkit-scrollbar {
                        width: 7px;
                        background-color: #F5F5F5;
                    }                     
                    &::-webkit-scrollbar-track {
                        -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.3); 
                        -webkit-border-radius: 7px;
                        border-radius: 7px;
                    }
                    &::-webkit-scrollbar-thumb {
                        background: #95E1D3; 
                    }
                    @media screen and (max-width:1024px){
                        padding: 10px;
                        font-size: 14px;
                        line-height: 16px;
                        height: 140px;
                    }
                }
            }
        }

    }
    @media screen and(max-width:1024px){
        svg{
            scale: 0.8;
        }        
    }
}

