.about{
    background-color: #FFFFFF;
    &__container{
        max-width: 1170px;
        margin: 0 auto;
    }
    &__wrapper{
        padding-top: 42px;
        padding-bottom: 108px;
        margin: 0 15px;
        @media screen and (max-width:1024px){
            padding-top: 22px;
            padding-bottom: 68px;
        }
    }
    .title-centr{
        .pure-line{
            margin-top: 24px;
            margin-bottom: 44px;
        }
    }
    &__cards{
        display: grid;
        grid-template: repeat( 1, 100%) / repeat(3, minmax(300px,370px)) ;
        gap: 30px;
        @media screen and (max-width:1024px){
            grid-template: repeat( 1, 100%) / repeat(3, minmax(250px,320px)) ;
            gap: 17px;
        }               
    }
    &__card{
        transition: 0.3s ease;
        &:nth-child(1){
            background: linear-gradient(360deg, rgba(237, 215, 137, 0.9) 0%, rgba(233, 130, 131, 0.9) 100%);      
        }
        .card-elements{
            width: 100%;
            height: 100%;
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
            span:nth-child(2){
                color: #FFFFFF;
                font-style: normal;
                font-weight: 500;
                font-size: 24px;
                line-height: 28px;
                margin-top: 30px;
            }
        }
    }
    &__card:hover{
        transform: translateY(-20px);
        box-shadow: 10px 10px 0px #95E1D3;
        transition: 0.5s;
    }
}

